INSERT INTO `wp_give_formmeta` ( `meta_id`, `form_id`, `meta_key`, `meta_value`) VALUES
(201, 1135, '_give_form_content', 'There are many variations of passages of Lorem Ipsum available, but the majority have suffered alteration in some.\r\n<strong>Special reasons for causes.</strong>\r\n01. Lorem ipsum dolor sit amet, consectetur adipiscing elit.\r\n02. Integer mollis dui at mauris posuere commodo.\r\n03. Nunc eget dolor vitae nisl tristique venenatis a ut sapien.\r\n04. Duis sit amet tellus eu ligula ultrices aliquet aliquet vitae leo.\r\n05. Donec congue ex et tellus pulvinar, eu iaculis lorem aliquam.'),
(202, 1135, '_give_terms_option', 'enabled'),
(203, 1135, '_give_agree_label', 'Agree to Terms ?'),
(204, 1135, '_give_agree_text', 'Acceptance of any contribution, gift or grant is at the discretion of the vorosa - Nonprofit Charity Theme. The vorosa - Nonprofit Charity Theme will not accept any gift unless it can be used or expended consistently with the purpose and mission of the vorosa - Nonprofit Charity Theme.\r\n\r\nNo irrevocable gift, whether outright or life-income in character, will be accepted if under any reasonable set of circumstances the gift would jeopardize the donor’s financial security.\r\n\r\nThe vorosa - Nonprofit Charity Theme will refrain from providing advice about the tax or other treatment of gifts and will encourage donors to seek guidance from their own professional advisers to assist them in the process of making their donation.\r\n\r\nThe vorosa - Nonprofit Charity Theme will accept donations of cash or publicly traded securities. Gifts of in-kind services will be accepted at the discretion of the vorosa - Nonprofit Charity Theme.\r\n\r\nCertain other gifts, real property, personal property, in-kind gifts, non-liquid securities, and contributions whose sources are not transparent or whose use is restricted in some manner, must be reviewed prior to acceptance due to the special obligations raised or liabilities they may pose for vorosa - Nonprofit Charity Theme.\r\n'),
(205, 1135, '_give_customize_offline_donations', 'global'),
(206, 1135, '_give_offline_donation_enable_billing_fields_single', 'disabled'),
(207, 1135, '_give_offline_checkout_notes', '<p>In order to make an offline donation we ask that you please follow these instructions: </p><ol><li>Make a check payable to "vorosa - Nonprofit Charity Theme"</li><li>On the memo line of the check, please indicate that the donation is for "vorosa - Nonprofit Charity Theme"</li><li>Please mail your check to:</li></ol>&nbsp;&nbsp;&nbsp;&nbsp;<em>vorosa - Nonprofit Charity Theme</em><br>&nbsp;&nbsp;&nbsp;&nbsp;<em>111 Not A Real St.</em><br>&nbsp;&nbsp;&nbsp;&nbsp;<em>Anytown, CA 12345 </em><br><p>All contributions will be gratefully acknowledged and are tax deductible.</p>'),
(208, 1135, '_give_offline_donation_subject', '{form_title} - Offline Donation Instructions'),
(209, 1135, '_give_offline_donation_email', '<p>Dear {name},</p><p>Thank you for your offline donation request! Your generosity is greatly appreciated. In order to make an offline donation we ask that you please follow these instructions:</p><ol><li>Make a check payable to "vorosa - Nonprofit Charity Theme"</li><li>On the memo line of the check, please indicate that the donation is for "vorosa - Nonprofit Charity Theme"</li><li>Please mail your check to:</li></ol>&nbsp;&nbsp;&nbsp;&nbsp;<em>vorosa - Nonprofit Charity Theme</em><br>&nbsp;&nbsp;&nbsp;&nbsp;<em>111 Not A Real St.</em><br>&nbsp;&nbsp;&nbsp;&nbsp;<em>Anytown, CA 12345 </em><br><p>Once your donation has been received we will mark it as complete and you will receive an email receipt for your records. Please contact us with any questions you may have!</p><p>Sincerely,</p><p>vorosa - Nonprofit Charity Theme</p>'),
(210, 1135, '_give_form_earnings', '3800.000000'),
(211, 1135, '_give_form_sales', '2') ;
