(241, 'spacious', 'a:21:{s:20:"spacious_site_layout";s:11:"wide_1218px";s:23:"spacious_default_layout";s:21:"no_sidebar_full_width";s:29:"spacious_pages_default_layout";s:21:"no_sidebar_full_width";s:36:"spacious_single_posts_default_layout";s:21:"no_sidebar_full_width";s:22:"spacious_primary_color";s:7:"#009400";s:24:"spacious_activate_slider";i:1;s:22:"spacious_slider_image1";s:63:"http://54.201.28.233/wp-content/uploads/2018/04/REDFS_hero1.jpg";s:22:"spacious_slider_title1";s:83:"The Rural Economic Development and Food Security (RED&amp;FS) Sector Working Group ";s:21:"spacious_slider_text1";s:301:"Our objective: Facilitate technical, operational and strategic level dialogue between the government and DPs and to mobilize and align development investments towards sector priorities identified by the GoE, as well as to harmonize investment and activities in order to maximize resource effectiveness";s:28:"spacious_slider_button_text1";s:10:"LEARN MORE";s:22:"spacious_slider_image2";s:61:"http://54.201.28.233/wp-content/uploads/2017/09/hero_ATA2.png";s:22:"spacious_slider_title2";s:13:"Working Group";s:21:"spacious_slider_text2";s:259:"The joint platform brings together the Government of Ethiopia (GoE), represented by the federal Ministry of Agriculture and Natural Resources (MoANR), Ministry of Livestock and Fisheries (MoLF), and the main development partners (DPs) engaged in the sectors. ";s:22:"spacious_slider_image3";s:61:"http://54.201.28.233/wp-content/uploads/2017/09/hero_ATA3.png";s:22:"spacious_slider_title3";s:20:"Technical Committees";s:21:"spacious_slider_text3";s:207:"Our technical committees are focused on the following: Livestock and Fisheries Production and Marketing; Agriculture Growth; Sustainable Land Management; and Rural Job Opportunity Creation and Food Security.";s:21:"spacious_slider_link1";s:40:"http://54.201.28.233/index.php/about-us/";s:28:"spacious_slider_button_text2";s:10:"LEARN MORE";s:21:"spacious_slider_link2";s:40:"http://54.201.28.233/index.php/about-us/";s:28:"spacious_slider_button_text3";s:10:"LEARN MORE";s:21:"spacious_slider_link3";s:40:"http://54.201.28.233/index.php/about-us/";}', 'yes'),
