(2501, '93b398a4d7303649f7769904a44f5777', 'a:2:{s:7:"timeout";i:1528170052;s:5:"value";s:7084:"{"new_version":"3.1","stable_version":"3.1","name":"Company Directory Pro","slug":"company-directory-pro","url":"https:\\/\\/goldplugins.com\\/downloads\\/company-directory-pro\\/?changelog=1","last_updated":"2018-04-12 11:40:23","homepage":"https:\\/\\/goldplugins.com\\/downloads\\/company-directory-pro\\/","package":"https:\\/\\/goldplugins.com\\/edd-sl\\/package_download\\/MTUyODIzMTIzMzpDRF9QUk9fYmQ0YTgyN2FiZDk1MjIyOTE3NWZhNDdhZDZiZmJjZjM6NzAxMTo0YzUzZWVmZTAwODJjOWNiYjY2NzE2M2E2Y2FmN2VjZDpodHRwQC8vNTQuMjAxLjI4LjIzMzow","download_link":"https:\\/\\/goldplugins.com\\/edd-sl\\/package_download\\/MTUyODIzMTIzMzpDRF9QUk9fYmQ0YTgyN2FiZDk1MjIyOTE3NWZhNDdhZDZiZmJjZjM6NzAxMTo0YzUzZWVmZTAwODJjOWNiYjY2NzE2M2E2Y2FmN2VjZDpodHRwQC8vNTQuMjAxLjI4LjIzMzow","sections":{"description":"<p><strong>Allow employees and website visitors to easily navigate your Staff Directory.<\\/strong><\\/p>\\n<p>When your staff gets so large that you can\\u2019t remember that guy\\u2019s name in accounting, it\\u2019s time to use Company Directory Pro to help your staff and website visitors track down the person they need for help.<\\/p>\\n<p>Company Directory Pro reduces the time and energy required to track down the right person in your organization by allowing you to easily manage and display your Staff or Faculty using one of three unique layouts\\u2014 List, Grid, and Table.<\\/p>\\n<p>The List View is the standard layout that comes stock with our directory, the Grid View is a great way to display medium-sized organizations and departments Staff Members, and the Table View is perfect for large organizations for displaying pertinent information of Staff or Faculty members in an easy-to-search, on page format. Both are great for small companies looking to present a bigger image!<\\/p>\\n<p>Whichever layout you choose, Company Directory Pro will make searching through your deep staff quick and easy.<br \\/>\\nFeatures:<\\/p>\\n<ul>\\n<li>Easily Create and Manage your Staff or Faculty members!<\\/li>\\n<li>Add Photos, Contact Information, and More!<\\/li>\\n<li>Two New Unique Layouts: the Table and Grid views!<\\/li>\\n<li>Easily Style Output using our Custom CSS Options!<\\/li>\\n<li>Supports unlimited Staff Members<\\/li>\\n<li>Easily import existing Staff Members via CSV, Excel file, or Active Directory \\/ LDAP<\\/li>\\n<li>Outstanding Support from Our Developers!<\\/li>\\n<\\/ul>\\n<p>See It In Action<br \\/>\\nCompany Directory Pro can display your staff in a variety of ways. Below are examples of the Staff Grid Style and the Staff Table styles, both of which are highly customizable. <\\/p>\\n<p>For more examples, visit our <a href=\\"https:\\/\\/goldplugins.com\\/documentation\\/company-directory-documentation\\/company-directory-pro-examples\\/\\">Examples Page<\\/a>.<\\/p>\\n<p>Staff Grid Example<br \\/>\\n[staff_list title=\\"Our Staff\\" order_by=\\"last_name\\" order=\\"ASC\\" style=\\"grid\\" show_name=\\"1\\" show_title=\\"1\\" show_bio=\\"1\\" show_photo=\\"1\\" show_email=\\"1\\" show_phone=\\"1\\" show_address=\\"1\\" show_website=\\"1\\" staff_per_page=\\"all\\" per_page=\\"10\\" category=\\"executives\\"]<\\/p>\\n<p>Staff Table Example<br \\/>\\n[staff_list title=\\"Our Staff\\" order_by=\\"last_name\\" order=\\"ASC\\" style=\\"table\\" show_name=\\"1\\" show_title=\\"1\\" show_bio=\\"0\\" show_photo=\\"1\\" show_email=\\"1\\" show_phone=\\"1\\" show_address=\\"0\\" show_website=\\"1\\" staff_per_page=\\"all\\" per_page=\\"10\\"]<\\/p>\\n<p>\\tGet Company Directory Pro Now<\\/p>\\n<p style=\\"text-align:center; margin-bottom: 45px;\\">Purchase Company Directory Now, and start loving your staff directory!<\\/p>\\n<p>[gp_pricing_table name=\\"company-directory-pro\\"]<\\/p>\\n<p>Frequently Asked Questions<\\/p>\\n<p>[faqs theme=\\"default_style\\" category=\\"pre-sales\\" count=\\"-1\\" orderby=\\"date\\" order=\\"DESC\\"]<\\/p>\\n<p>[single_testimonial id=\\"1862\\" use_excerpt=\\"1\\" show_thumbs=\\"1\\" show_date=\\"1\\" show_other=\\"1\\" hide_view_more=\\"1\\" show_rating=\\"stars\\"]<\\/p>\\n","changelog":""},"banners":{"high":"","low":""},"description":["<p><strong>Allow employees and website visitors to easily navigate your Staff Directory.<\\/strong><\\/p>\\n<p>When your staff gets so large that you can\\u2019t remember that guy\\u2019s name in accounting, it\\u2019s time to use Company Directory Pro to help your staff and website visitors track down the person they need for help.<\\/p>\\n<p>Company Directory Pro reduces the time and energy required to track down the right person in your organization by allowing you to easily manage and display your Staff or Faculty using one of three unique layouts\\u2014 List, Grid, and Table.<\\/p>\\n<p>The List View is the standard layout that comes stock with our directory, the Grid View is a great way to display medium-sized organizations and departments Staff Members, and the Table View is perfect for large organizations for displaying pertinent information of Staff or Faculty members in an easy-to-search, on page format. Both are great for small companies looking to present a bigger image!<\\/p>\\n<p>Whichever layout you choose, Company Directory Pro will make searching through your deep staff quick and easy.<br \\/>\\nFeatures:<\\/p>\\n<ul>\\n<li>Easily Create and Manage your Staff or Faculty members!<\\/li>\\n<li>Add Photos, Contact Information, and More!<\\/li>\\n<li>Two New Unique Layouts: the Table and Grid views!<\\/li>\\n<li>Easily Style Output using our Custom CSS Options!<\\/li>\\n<li>Supports unlimited Staff Members<\\/li>\\n<li>Easily import existing Staff Members via CSV, Excel file, or Active Directory \\/ LDAP<\\/li>\\n<li>Outstanding Support from Our Developers!<\\/li>\\n<\\/ul>\\n<p>See It In Action<br \\/>\\nCompany Directory Pro can display your staff in a variety of ways. Below are examples of the Staff Grid Style and the Staff Table styles, both of which are highly customizable. <\\/p>\\n<p>For more examples, visit our <a href=\\"https:\\/\\/goldplugins.com\\/documentation\\/company-directory-documentation\\/company-directory-pro-examples\\/\\">Examples Page<\\/a>.<\\/p>\\n<p>Staff Grid Example<br \\/>\\n[staff_list title=\\"Our Staff\\" order_by=\\"last_name\\" order=\\"ASC\\" style=\\"grid\\" show_name=\\"1\\" show_title=\\"1\\" show_bio=\\"1\\" show_photo=\\"1\\" show_email=\\"1\\" show_phone=\\"1\\" show_address=\\"1\\" show_website=\\"1\\" staff_per_page=\\"all\\" per_page=\\"10\\" category=\\"executives\\"]<\\/p>\\n<p>Staff Table Example<br \\/>\\n[staff_list title=\\"Our Staff\\" order_by=\\"last_name\\" order=\\"ASC\\" style=\\"table\\" show_name=\\"1\\" show_title=\\"1\\" show_bio=\\"0\\" show_photo=\\"1\\" show_email=\\"1\\" show_phone=\\"1\\" show_address=\\"0\\" show_website=\\"1\\" staff_per_page=\\"all\\" per_page=\\"10\\"]<\\/p>\\n<p>\\tGet Company Directory Pro Now<\\/p>\\n<p style=\\"text-align:center; margin-bottom: 45px;\\">Purchase Company Directory Now, and start loving your staff directory!<\\/p>\\n<p>[gp_pricing_table name=\\"company-directory-pro\\"]<\\/p>\\n<p>Frequently Asked Questions<\\/p>\\n<p>[faqs theme=\\"default_style\\" category=\\"pre-sales\\" count=\\"-1\\" orderby=\\"date\\" order=\\"DESC\\"]<\\/p>\\n<p>[single_testimonial id=\\"1862\\" use_excerpt=\\"1\\" show_thumbs=\\"1\\" show_date=\\"1\\" show_other=\\"1\\" hide_view_more=\\"1\\" show_rating=\\"stars\\"]<\\/p>\\n"],"changelog":[""]}";}', 'yes'),
