(8840, 'give_settings', 'a:47:{i:0;b:0;s:12:"base_country";s:2:"US";s:9:"test_mode";s:7:"enabled";s:8:"currency";s:3:"USD";s:17:"currency_position";s:6:"before";s:16:"session_lifetime";s:6:"604800";s:12:"email_access";s:7:"enabled";s:19:"thousands_separator";s:1:",";s:17:"decimal_separator";s:1:".";s:15:"number_decimals";i:2;s:26:"sequential-ordering_status";s:7:"enabled";s:3:"css";s:7:"enabled";s:11:"floatlabels";s:8:"disabled";s:7:"welcome";s:7:"enabled";s:13:"company_field";s:8:"disabled";s:14:"forms_singular";s:7:"enabled";s:14:"forms_archives";s:7:"enabled";s:13:"forms_excerpt";s:7:"enabled";s:17:"form_featured_img";s:7:"enabled";s:12:"form_sidebar";s:7:"enabled";s:10:"categories";s:8:"disabled";s:4:"tags";s:8:"disabled";s:5:"terms";s:8:"disabled";s:13:"admin_notices";s:7:"enabled";s:5:"cache";s:7:"enabled";s:19:"uninstall_on_delete";s:8:"disabled";s:18:"the_content_filter";s:7:"enabled";s:14:"scripts_footer";s:8:"disabled";s:20:"agree_to_terms_label";s:15:"Agree to Terms?";s:14:"agreement_text";s:1873:"<p>Acceptance of any contribution, gift or grant is at the discretion of the REDFS. The  REDFS will not accept any gift unless it can be used or expended consistently with the purpose and mission of the  REDFS.</p>\n				<p>No irrevocable gift, whether outright or life-income in character, will be accepted if under any reasonable set of circumstances the gift would jeopardize the donor’s financial security.</p>\n				<p>The REDFS will refrain from providing advice about the tax or other treatment of gifts and will encourage donors to seek guidance from their own professional advisers to assist them in the process of making their donation.</p>\n				<p>The REDFS will accept donations of cash or publicly traded securities. Gifts of in-kind services will be accepted at the discretion of the REDFS.</p>\n				<p>Certain other gifts, real property, personal property, in-kind gifts, non-liquid securities, and contributions whose sources are not transparent or whose use is restricted in some manner, must be reviewed prior to acceptance due to the special obligations raised or liabilities they may pose for REDFS.</p>\n				<p>The REDFS will provide acknowledgments to donors meeting tax requirements for property received by the charity as a gift. However, except for gifts of cash and publicly traded securities, no value shall be ascribed to any receipt or other form of substantiation of a gift received by REDFS.</p>\n				<p>The REDFS will respect the intent of the donor relating to gifts for restricted purposes and those relating to the desire to remain anonymous. With respect to anonymous gifts, the REDFS will restrict information about the donor to only those staff members with a need to know.</p>\n				<p>The REDFS will not compensate, whether through commissions, finders\' fees, or other means, any third party for directing a gift or a donor to the REDFS.</p>";s:19:"paypal_verification";s:7:"enabled";s:8:"gateways";a:2:{s:6:"manual";i:1;s:7:"offline";i:1;}s:15:"default_gateway";s:6:"manual";s:31:"global_offline_donation_content";s:498:"<p>In order to make an offline donation we ask that you please follow these instructions: </p><ol><li>Make a check payable to "REDFS"</li><li>On the memo line of the check, please indicate that the donation is for "REDFS"</li><li>Please mail your check to:</li></ol>&nbsp;&nbsp;&nbsp;&nbsp;<em>REDFS</em><br>&nbsp;&nbsp;&nbsp;&nbsp;<em>111 Not A Real St.</em><br>&nbsp;&nbsp;&nbsp;&nbsp;<em>Anytown, CA 12345 </em><br><p>All contributions will be gratefully acknowledged and are tax deductible.</p>";s:43:"give_offline_donation_enable_billing_fields";s:8:"disabled";s:23:"donor_default_user_role";s:10:"give_donor";s:42:"offline-donation-instruction_email_message";s:498:"<p>In order to make an offline donation we ask that you please follow these instructions: </p><ol><li>Make a check payable to "REDFS"</li><li>On the memo line of the check, please indicate that the donation is for "REDFS"</li><li>Please mail your check to:</li></ol>&nbsp;&nbsp;&nbsp;&nbsp;<em>REDFS</em><br>&nbsp;&nbsp;&nbsp;&nbsp;<em>111 Not A Real St.</em><br>&nbsp;&nbsp;&nbsp;&nbsp;<em>Anytown, CA 12345 </em><br><p>All contributions will be gratefully acknowledged and are tax deductible.</p>";s:30:"donation-receipt_email_message";s:436:"Dear {name},\n\nThank you for your donation. Your generosity is appreciated! Here are the details of your donation:\n\n<strong>Donor:</strong> {fullname}\n<strong>Donation:</strong> {donation}\n<strong>Donation Date:</strong> {date}\n<strong>Amount:</strong> {amount}\n<strong>Payment Method:</strong> {payment_method}\n<strong>Payment ID:</strong> {payment_id}\n<strong>Receipt ID:</strong> {receipt_id}\n\n{receipt_link}\n\n\n\nSincerely,\n{sitename}\n";s:26:"new-donation_email_message";s:341:"Hi there,\n\nThis email is to inform you that a new donation has been made on your website: <a href="http://54.201.28.233" target="_blank">http://54.201.28.233</a>.\n\n<strong>Donor:</strong> {name}\n<strong>Donation:</strong> {donation}\n<strong>Amount:</strong> {amount}\n<strong>Payment Method:</strong> {payment_method}\n\nThank you,\n\n{sitename}\n";s:22:"new-donation_recipient";a:1:{i:0;s:25:"rrodriguez@spatialdev.com";}s:30:"new-offline-donation_recipient";a:1:{i:0;s:25:"rrodriguez@spatialdev.com";}s:28:"new-donor-register_recipient";a:1:{i:0;s:25:"rrodriguez@spatialdev.com";}s:25:"new-donation_notification";s:7:"enabled";s:26:"sequential-ordering_number";i:71;s:12:"success_page";i:323;s:12:"failure_page";i:325;s:12:"history_page";i:327;}', 'yes'),
