(10121, 'fl_notifications', 'a:3:{s:4:"read";b:1;s:8:"checksum";a:5:{i:352086;i:1712285855;i:347444;i:2016001167;i:344408;i:4147876357;i:337380;i:61041398;i:333965;i:4130695;}s:4:"data";s:9655:"[{"id":352086,"date":"2018-04-26T11:28:42","date_gmt":"2018-04-26T18:28:42","guid":{"rendered":"https:\\/\\/www.wpbeaverbuilder.com\\/?post_type=fl_notification&#038;p=352086"},"modified":"2018-04-26T11:28:42","modified_gmt":"2018-04-26T18:28:42","slug":"happy-4th-birthday-to-beaver-builder","status":"publish","type":"fl_notification","link":"https:\\/\\/www.wpbeaverbuilder.com\\/?fl_notification=happy-4th-birthday-to-beaver-builder","title":{"rendered":"Happy 4th Birthday to Beaver Builder"},"content":{"rendered":"<p><img class=\\"aligncenter size-full wp-image-352087\\" src=\\"https:\\/\\/www.wpbeaverbuilder.com\\/wp-content\\/uploads\\/2018\\/04\\/bday-notification.jpg\\" alt=\\"\\" width=\\"318\\" height=\\"139\\" srcset=\\"https:\\/\\/www.wpbeaverbuilder.com\\/wp-content\\/uploads\\/2018\\/04\\/bday-notification.jpg 318w, https:\\/\\/www.wpbeaverbuilder.com\\/wp-content\\/uploads\\/2018\\/04\\/bday-notification-300x131.jpg 300w\\" sizes=\\"(max-width: 318px) 100vw, 318px\\" \\/><\\/p>\\n<p>For the last few years, we\\u2019ve made a point to celebrate our birthday here at\\u00a0Beaver Builder. It\\u2019s hard to believe, since starting this journey from client work to products, a whole four years have gone by.<\\/p>\\n","protected":false},"template":"","meta":{"_fl_notification":["https:\\/\\/www.wpbeaverbuilder.com\\/happy-4th-birthday-to-beaver-builder\\/"]},"_links":{"self":[{"href":"https:\\/\\/www.wpbeaverbuilder.com\\/wp-json\\/wp\\/v2\\/fl_notification\\/352086"}],"collection":[{"href":"https:\\/\\/www.wpbeaverbuilder.com\\/wp-json\\/wp\\/v2\\/fl_notification"}],"about":[{"href":"https:\\/\\/www.wpbeaverbuilder.com\\/wp-json\\/wp\\/v2\\/types\\/fl_notification"}],"wp:attachment":[{"href":"https:\\/\\/www.wpbeaverbuilder.com\\/wp-json\\/wp\\/v2\\/media?parent=352086"}],"curies":[{"name":"wp","href":"https:\\/\\/api.w.org\\/{rel}","templated":true}]}},{"id":347444,"date":"2018-04-04T16:27:13","date_gmt":"2018-04-04T23:27:13","guid":{"rendered":"https:\\/\\/www.wpbeaverbuilder.com\\/?post_type=fl_notification&#038;p=347444"},"modified":"2018-04-04T16:27:13","modified_gmt":"2018-04-04T23:27:13","slug":"beaver-builder-2-1-redridge","status":"publish","type":"fl_notification","link":"https:\\/\\/www.wpbeaverbuilder.com\\/?fl_notification=beaver-builder-2-1-redridge","title":{"rendered":"Beaver Builder 2.1 &#8220;Redridge&#8221;"},"content":{"rendered":"<p><img class=\\"aligncenter size-full wp-image-347445\\" src=\\"https:\\/\\/www.wpbeaverbuilder.com\\/wp-content\\/uploads\\/2018\\/04\\/redridge-notification-normal.jpg\\" alt=\\"\\" width=\\"318\\" height=\\"139\\" srcset=\\"https:\\/\\/www.wpbeaverbuilder.com\\/wp-content\\/uploads\\/2018\\/04\\/redridge-notification-normal.jpg 318w, https:\\/\\/www.wpbeaverbuilder.com\\/wp-content\\/uploads\\/2018\\/04\\/redridge-notification-normal-300x131.jpg 300w\\" sizes=\\"(max-width: 318px) 100vw, 318px\\" \\/><\\/p>\\n<p>Beaver Builder 2.1 &#8220;Redridge&#8221; introduces a TON of new features and workflow improvements. If you\'re reading this, our new notification center here is one of them! Redridge also brings inline editing, saved columns, Gutenberg support, code validation, and a whole lot more. Click here to check out our release post and learn about all the new goodies.<\\/p>\\n","protected":false},"template":"","meta":{"_fl_notification":["https:\\/\\/www.wpbeaverbuilder.com\\/beaver-builder-2-1-redridge\\/"]},"_links":{"self":[{"href":"https:\\/\\/www.wpbeaverbuilder.com\\/wp-json\\/wp\\/v2\\/fl_notification\\/347444"}],"collection":[{"href":"https:\\/\\/www.wpbeaverbuilder.com\\/wp-json\\/wp\\/v2\\/fl_notification"}],"about":[{"href":"https:\\/\\/www.wpbeaverbuilder.com\\/wp-json\\/wp\\/v2\\/types\\/fl_notification"}],"wp:attachment":[{"href":"https:\\/\\/www.wpbeaverbuilder.com\\/wp-json\\/wp\\/v2\\/media?parent=347444"}],"curies":[{"name":"wp","href":"https:\\/\\/api.w.org\\/{rel}","templated":true}]}},{"id":344408,"date":"2018-03-22T10:40:12","date_gmt":"2018-03-22T17:40:12","guid":{"rendered":"https:\\/\\/www.wpbeaverbuilder.com\\/?post_type=fl_notification&#038;p=344408"},"modified":"2018-03-22T10:51:16","modified_gmt":"2018-03-22T17:51:16","slug":"beaver-builder-team-ask-us-anything","status":"publish","type":"fl_notification","link":"https:\\/\\/www.wpbeaverbuilder.com\\/?fl_notification=beaver-builder-team-ask-us-anything","title":{"rendered":"Beaver Builder Team Ask Us Anything"},"content":{"rendered":"<p><img class=\\"aligncenter size-full wp-image-344409\\" src=\\"https:\\/\\/www.wpbeaverbuilder.com\\/wp-content\\/uploads\\/2018\\/03\\/ama-notification.jpg\\" alt=\\"\\" width=\\"318\\" height=\\"139\\" srcset=\\"https:\\/\\/www.wpbeaverbuilder.com\\/wp-content\\/uploads\\/2018\\/03\\/ama-notification.jpg 318w, https:\\/\\/www.wpbeaverbuilder.com\\/wp-content\\/uploads\\/2018\\/03\\/ama-notification-300x131.jpg 300w\\" sizes=\\"(max-width: 318px) 100vw, 318px\\" \\/><\\/p>\\n<p>In our latest update, Billy, Brent, Justin, and Robby sit down and answer your questions in video format! We also discuss the 2.1 alpha (which you\'re probably aware of if you\'re reading this notification\\u00a0\\ud83d\\ude02) and a lot more&#8230;<\\/p>\\n","protected":false},"template":"","meta":{"_fl_notification":["https:\\/\\/www.wpbeaverbuilder.com\\/ask-us-anything-ama-update-post\\/"]},"_links":{"self":[{"href":"https:\\/\\/www.wpbeaverbuilder.com\\/wp-json\\/wp\\/v2\\/fl_notification\\/344408"}],"collection":[{"href":"https:\\/\\/www.wpbeaverbuilder.com\\/wp-json\\/wp\\/v2\\/fl_notification"}],"about":[{"href":"https:\\/\\/www.wpbeaverbuilder.com\\/wp-json\\/wp\\/v2\\/types\\/fl_notification"}],"wp:attachment":[{"href":"https:\\/\\/www.wpbeaverbuilder.com\\/wp-json\\/wp\\/v2\\/media?parent=344408"}],"curies":[{"name":"wp","href":"https:\\/\\/api.w.org\\/{rel}","templated":true}]}},{"id":337380,"date":"2018-02-21T10:41:52","date_gmt":"2018-02-21T18:41:52","guid":{"rendered":"https:\\/\\/www.wpbeaverbuilder.com\\/?post_type=fl_notification&#038;p=337380"},"modified":"2018-02-21T10:41:52","modified_gmt":"2018-02-21T18:41:52","slug":"48-websites-48-hours","status":"publish","type":"fl_notification","link":"https:\\/\\/www.wpbeaverbuilder.com\\/?fl_notification=48-websites-48-hours","title":{"rendered":"48 Websites in 48 Hours"},"content":{"rendered":"<p><img class=\\"size-full wp-image-337381 aligncenter\\" src=\\"https:\\/\\/www.wpbeaverbuilder.com\\/wp-content\\/uploads\\/2018\\/02\\/48in48-case-study-notification.jpg\\" alt=\\"\\" width=\\"318\\" height=\\"139\\" srcset=\\"https:\\/\\/www.wpbeaverbuilder.com\\/wp-content\\/uploads\\/2018\\/02\\/48in48-case-study-notification.jpg 318w, https:\\/\\/www.wpbeaverbuilder.com\\/wp-content\\/uploads\\/2018\\/02\\/48in48-case-study-notification-300x131.jpg 300w\\" sizes=\\"(max-width: 318px) 100vw, 318px\\" \\/><\\/p>\\n<p>Check out this story about how our friends at 48in48 use\\u00a0Beaver Builder to create 48 nonprofit websites in 48 hours at their events hosted throughout the world.<\\/p>\\n","protected":false},"template":"","meta":{"_fl_notification":["https:\\/\\/www.wpbeaverbuilder.com\\/48in48-case-study-building-48-websites-nonprofits-48-hours\\/"]},"_links":{"self":[{"href":"https:\\/\\/www.wpbeaverbuilder.com\\/wp-json\\/wp\\/v2\\/fl_notification\\/337380"}],"collection":[{"href":"https:\\/\\/www.wpbeaverbuilder.com\\/wp-json\\/wp\\/v2\\/fl_notification"}],"about":[{"href":"https:\\/\\/www.wpbeaverbuilder.com\\/wp-json\\/wp\\/v2\\/types\\/fl_notification"}],"wp:attachment":[{"href":"https:\\/\\/www.wpbeaverbuilder.com\\/wp-json\\/wp\\/v2\\/media?parent=337380"}],"curies":[{"name":"wp","href":"https:\\/\\/api.w.org\\/{rel}","templated":true}]}},{"id":333965,"date":"2018-02-06T11:54:04","date_gmt":"2018-02-06T19:54:04","guid":{"rendered":"https:\\/\\/www.wpbeaverbuilder.com\\/?post_type=fl_notification&#038;p=333965"},"modified":"2018-02-15T12:09:49","modified_gmt":"2018-02-15T20:09:49","slug":"welcome-2-1-alpha","status":"publish","type":"fl_notification","link":"https:\\/\\/www.wpbeaverbuilder.com\\/?fl_notification=welcome-2-1-alpha","title":{"rendered":"Welcome to 2.1 Alpha!"},"content":{"rendered":"<p><a href=\\"https:\\/\\/www.wpbeaverbuilder.com\\/wp-content\\/uploads\\/2018\\/01\\/thick-beaver.png\\"><img class=\\"size-full wp-image-332142 alignleft\\" src=\\"https:\\/\\/www.wpbeaverbuilder.com\\/wp-content\\/uploads\\/2018\\/01\\/thick-beaver.png\\" alt=\\"\\" width=\\"80\\" height=\\"80\\" srcset=\\"https:\\/\\/www.wpbeaverbuilder.com\\/wp-content\\/uploads\\/2018\\/01\\/thick-beaver.png 80w, https:\\/\\/www.wpbeaverbuilder.com\\/wp-content\\/uploads\\/2018\\/01\\/thick-beaver-45x45.png 45w\\" sizes=\\"(max-width: 80px) 100vw, 80px\\" \\/><\\/a>\\u00a0Hey there! Thank you so much for installing the latest alpha build of\\u00a0Beaver Builder. This is our new notification center! The plan here is to make it easier for us to communicate with\\u00a0<em>you.<\\/em> From here, we can share news about updates and new features, share our blog posts and tutorials, and push out helpful information to everyone using\\u00a0Beaver Builder.<\\/p>\\n<p>During the alpha period, we will be testing the notification center here. We may send out videos, or blogs posts, or different types of content for testing purposes. We\'ll do our best to keep them informative and entertaining, but do be aware that, for the most part, these will be &#8220;alpha&#8221; notifications. Thanks, again!<\\/p>\\n","protected":false},"template":"","meta":{"_fl_notification":["https:\\/\\/www.wpbeaverbuilder.com"]},"_links":{"self":[{"href":"https:\\/\\/www.wpbeaverbuilder.com\\/wp-json\\/wp\\/v2\\/fl_notification\\/333965"}],"collection":[{"href":"https:\\/\\/www.wpbeaverbuilder.com\\/wp-json\\/wp\\/v2\\/fl_notification"}],"about":[{"href":"https:\\/\\/www.wpbeaverbuilder.com\\/wp-json\\/wp\\/v2\\/types\\/fl_notification"}],"wp:attachment":[{"href":"https:\\/\\/www.wpbeaverbuilder.com\\/wp-json\\/wp\\/v2\\/media?parent=333965"}],"curies":[{"name":"wp","href":"https:\\/\\/api.w.org\\/{rel}","templated":true}]}}]";}', 'yes'),
