(116, 12, 'dslc_content_for_search', '<p class="p1">The Rural Economic Development and Food Security (RED&amp;FS) Sector Working Group was established in 2008 with the purpose to act as a platform bringing together the Government of Ethiopia,<span class="Apple-converted-space">&nbsp; </span>with its Development Partners who are active in the Agriculture Sector. The broad objectives of the platform are to facilitate dialogue between the government and DPs,<span class="Apple-converted-space">&nbsp; </span>mobilize and direct development investments towards the identified priorities of the government, and harmonize those investments in order to enhance Resource Effectiveness.</p>\n<img src="http://54.201.28.233/wp-content/uploads/2018/03/programs_corn.png" alt="" title="programs_corn">\n<h4>Programs</h4>\nRead more about the three flagship programs that RED&amp;FS supports.\n<a href="http://54.201.28.233/index.php/programs/" target="_self"> READ MORE </a>\n<img src="http://54.201.28.233/wp-content/uploads/2018/03/documents.png" alt="" title="documents">\n<h4>Documents</h4>\nVisit our document library which houses policy and technical documents, as well as information from committees.\n<a href="http://54.201.28.233/index.php/mdocuments-library/" target="_self"> SEE DOCUMENTS </a>\n<img src="http://54.201.28.233/wp-content/uploads/2018/03/yellowpages.png" alt="" title="yellowpages">\n<h4>Yellow Pages</h4>\nFind contacts related to various programs and activities with the yellow pages directory.\n<a href="http://54.201.28.233/index.php/yellow-pages/" target="_self"> SEE YELLOW PAGES </a>\n<img src="http://54.201.28.233/wp-content/uploads/2018/03/calendar-1.png" alt="" title="calendar">\n<h4>Events</h4>\nThe calendar of events shows scheduled activities and programs and can be filtered by specific interest.\n<a href="http://54.201.28.233/index.php/events/" target="_self"> SEE EVENTS </a>\n'),
