(751, 86, 'dslc_code', '[{"element_type":"row","columns_spacing":"spacing","custom_class":"","show_on":"desktop tablet phone","section_instance_id":"81e4aec8f75","custom_id":"","type":"wrapper","bg_color":"","bg_image_thumb":"disabled","bg_image":"","bg_image_repeat":"repeat","bg_image_position":"left top","bg_image_attachment":"scroll","bg_image_size":"auto","bg_video":"","bg_video_overlay_color":"#000000","bg_video_overlay_opacity":"0","border_color":"","border_width":"0","border_style":"solid","border":"top right bottom left","margin_h":"0","margin_b":"0","padding":"80","padding_h":"0","content":[{"element_type":"module_area","last":"yes","first":"no","size":"12","content":[{"css_show_on":"desktop tablet phone","content":"<p><strong>Q 1. What is REDFS SWG? </strong></p><p>The Rural Economic Development and Food Security Sector Working Group (REDFS SWG) is the joint Government - Donor coordination platform for agriculture, Natural Resource Management and Food Security. Its objective is to jointly review sector level implementation status, coordinate and harmonize efforts of various development partners supporting flagship programmes under REDFS.</p><p><strong>Q 2. Who chaired the REDFS SWG? </strong></p><p>The SWG is chaired by two federal Ministers, namely H.E. Dr. Eyasu Abraha, Minister, Ministry of Agriculture & Natural Resources and H.E. Professor Fekadu Beyene; Minister, Ministry of Livestock and Fishery, and co-chaired by EU’s Dominique Davoux and USAID’s Stephen Morin.</p><p><strong>Q 3. When was REDFS SWG established?</strong></p><p>The REDFS SWG was formally established in April 2008, and is composed of an Executive Committee and four Technical Committees namely, Agricultural Growth; Sustainable Land Management; Livestock & Fisheries Development and Rural Job Opportunity Creation and Food Security.</p><p><strong> Q 4. Who are members of the REDFS SWG?</strong></p><p>The RED&FS membership includes the Ministries of Agriculture and Natural Resources and Livestock & Fisheries Resources and their associated Directorates. Membership from Development Partners side includes the major Multi and Bi-Lateral Development Institutions that are engaged in the aforementioned sectors. Participation in the Technical Committees is open to those institutions that have the interest, expertise and capacity to engage in and contribute to the work of the sector.</p>","css_custom":"enabled","css_main_bg_img_repeat":"repeat","css_main_bg_img_attch":"scroll","css_main_bg_img_pos":"top left","css_main_bg_img_size":"auto","css_main_border_trbl":"top right bottom left","css_main_font_size":"13","css_main_font_weight":"400","css_main_font_family":"Open Sans","css_main_font_style":"normal","css_main_line_height":"22","css_main_margin_bottom":"25","css_main_text_align":"left","css_h1_font_size":"25","css_h1_font_weight":"400","css_h1_font_family":"Open Sans","css_h1_font_style":"normal","css_h1_line_height":"35","css_h1_margin_bottom":"15","css_h1_text_align":"left","css_h1_border_trbl":"top right bottom left","css_h2_font_size":"23","css_h2_font_weight":"400","css_h2_font_family":"Open Sans","css_h2_font_style":"normal","css_h2_line_height":"33","css_h2_margin_bottom":"15","css_h2_text_align":"left","css_h2_border_trbl":"top right bottom left","css_h3_font_size":"21","css_h3_font_weight":"400","css_h3_font_family":"Open Sans","css_h3_font_style":"normal","css_h3_line_height":"31","css_h3_margin_bottom":"15","css_h3_text_align":"left","css_h3_border_trbl":"top right bottom left","css_h4_font_size":"19","css_h4_font_weight":"400","css_h4_font_family":"Open Sans","css_h4_font_style":"normal","css_h4_line_height":"29","css_h4_margin_bottom":"15","css_h4_text_align":"left","css_h4_border_trbl":"top right bottom left","css_h5_font_size":"17","css_h5_font_weight":"400","css_h5_font_family":"Open Sans","css_h5_font_style":"normal","css_h5_line_height":"27","css_h5_margin_bottom":"15","css_h5_text_align":"left","css_h5_border_trbl":"top right bottom left"