(86, 1, '2017-09-13 19:45:29', '2017-09-13 19:45:29', '<strong>Q 1. What is REDFS SWG? </strong>\r\n\r\nThe Rural Economic Development and Food Security Sector Working Group (REDFS SWG) is the joint Government - Donor coordination platform for agriculture, Natural Resource Management and Food Security. Its objective is to jointly review sector level implementation status, coordinate and harmonize efforts of various development partners supporting flagship programmes under REDFS.\r\n\r\n<strong>Q 2. Who chaired the REDFS SWG? </strong>\r\n\r\nThe SWG is chaired by two federal Ministers, namely H.E. Dr. Eyasu Abraha, Minister, Ministry of Agriculture &amp; Natural Resources and H.E. Professor Fekadu Beyene; Minister, Ministry of Livestock and Fishery, and co-chaired by EU’s Dominique Davoux and USAID’s Stephen Morin.\r\n\r\n<strong>Q 3. When was REDFS SWG established?</strong>\r\n\r\nThe REDFS SWG was formally established in April 2008, and is composed of an Executive Committee and four Technical Committees namely, Agricultural Growth; Sustainable Land Management; Livestock &amp; Fisheries Development and Rural Job Opportunity Creation and Food Security.\r\n\r\n<strong> Q 4. Who are members of the REDFS SWG?</strong>\r\n\r\nThe RED&amp;FS membership includes the Ministries of Agriculture and Natural Resources and Livestock &amp; Fisheries Resources and their associated Directorates. Membership from Development Partners side includes the major Multi and Bi-Lateral Development Institutions that are engaged in the aforementioned sectors. Participation in the Technical Committees is open to those institutions that have the interest, expertise and capacity to engage in and contribute to the work of the sector.\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;', 'FAQs', '', 'publish', 'closed', 'closed', '', 'faqs', '', '', '2018-03-21 21:20:59', '2018-03-21 21:20:59', '', 0, 'http://54.201.28.233/?page_id=86', 0, 'page', '', 0),
