(127, 1, '2017-10-09 21:48:15', '2017-10-09 21:48:15', '<h2>About RED&amp;FS</h2>\r\nThe Rural Economic Development and Food Security (RED&amp;FS) Sector Working Group was established in 2008 to serve as a joint platform, bringing together the Government of Ethiopia (GoE), represented by the federal Ministry of Agriculture and Natural Resources (MoANR), Ministry of Livestock and Fisheries (MoLF), and the main development partners (DPs) engaged in the sectors. The platform’s objectives are to facilitate technical, operational and strategic level dialogue between the government and DPs and to mobilize and align development investments towards sector priorities identified by the GoE, as well as to harmonize investment and activities in order to maximize resource effectiveness. RED&amp;FS operates within the tenets and framework of the Paris Declaration on Aid Effectiveness.\r\n<h2>RED&amp;FS Organizational Structure</h2>\r\nRED&amp;FS is built on four pillar Technical Committees (TCs) that mirror the state ministerial structure of the two federal ministries, each chaired by the respective sector state minister and supported by two DP co-chairs. The TCs are: Livestock and Fisheries Production and Marketing; Agriculture Growth; Sustainable Land Management; and Rural Job Opportunity Creation and Food Security. Each TC is further broken down into focused sub-sector Task Forces (TFs) which are chaired by a government director and co-chaired by DP representatives. Oversight to the entire structure is provided through an Executive Committee chaired by the two federal ministers and also supported by DP co-chairs. The platform also features cross-sector TFs not aligned to any specific sector.\r\n\r\nThe RED&amp;FS Secretariat provides broad and agile support to the entire sector and consists of a Government Coordinator, Donor Coordinator, Monitoring and Evaluation (M&amp;E) Expert, and support staff. The RED&amp;FS Organizational Chart is shown below.\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;', 'About RED&FS', '', 'publish', 'closed', 'closed', '', 'about-us', '', '', '2018-03-21 18:59:00', '2018-03-21 18:59:00', '', 0, 'http://54.201.28.233/?page_id=127', 0, 'page', '', 0),
