(133, 1, '2017-10-09 21:48:48', '2017-10-09 21:48:48', '<h2>Flagship Programs</h2>\r\nThe agriculture sector features three flagship programs. These are large, multi-partnered approaches that create high levels of investment efficiency. All of the programs feature resource alignment through ministry-based coordination units and resource harmonization through several modalities, including basket-funding, parallel funding, and common work plans.\r\n<h2>Agriculture Growth Program</h2>\r\nThe second phase Agriculture Growth Program (AGP 2), from 2015-2020, amounting to 581.8 million USD, is a multifaceted investment program operational in 157 high-potential woredas. The development objective of AGP 2 is to increase agricultural productivity and commercialization of smallholder farmers with particular focus on women and youth beneficiaries. The project comprises five components.\r\n<ol>\r\n 	<li><strong>Agricultural public support services</strong> will increase access to public agricultural services for smallholder farmers.</li>\r\n 	<li><strong>Agricultural research</strong> will increase the supply of demand-driven agricultural technologies, which directly link to the other components.</li>\r\n 	<li><strong>Small-scale irrigation</strong> will increase the access to and efficient utilization of irrigation water by smallholder farmers.</li>\r\n 	<li><strong>Agricultural marketing and value chains</strong> will commercialize smallholder farmers through increased access to input and output markets.</li>\r\n 	<li><strong>Project management, capacity building, and M&amp;E</strong> will ensure efficient project implementation, M&amp;E of results, and a consistent and effective approach to capacity building.</li>\r\n</ol>\r\nNutrition, gender, and climate smart agriculture considerations are mainstreamed throughout all components.\r\n<h2>Sustainable Land Management Program</h2>\r\nThe second phase Sustainable Land Management Program (SLMP 2), covering the years 2014-2019 and 107 million USD, conducts activities to rehabilitate and protect natural resources. Its objective is to reduce land degradation and improve land productivity in selected watersheds in the highlands of Ethiopia. There are four components to the project.\r\n<ol>\r\n 	<li><strong>Integrated watershed and landscape management</strong> supports scale-up and adoption of appropriate sustainable land and water management technologies and practices by smallholder farmers and communities.</li>\r\n 	<li><strong>Institutional strengthening, capacity development and knowledge generation and management</strong> complements on-the-ground activities to be implemented under component one by strengthening and enhancing institutional capacity and building relevant skills and knowledge of stakeholders (including government agencies, research organizations and academia involved in the sustainable natural resource management, as well as the private sector, community leaders and smallholder farmers).</li>\r\n 	<li><strong>Rural land administration</strong> enhances the tenure security of smallholder farmers in order to increase their motivation to adopt sustainable land and water management practices on communal and individual land.</li>\r\n 	<li><strong>Enhancing the skills and capacities of project managers and administrators.</strong></li>\r\n</ol>\r\n<h2>Productive Safety Net Program</h2>\r\nThe fourth phase Productive Safety Net Program (PSNP 4), spanning from 2015 to 2020, with an investment of 4.8 billion USD, ensures food security through a system of food/cash transfers to vulnerable households. PSNP 4 has the objective to increase access to safety net and disaster risk management systems, complementary livelihoods services, and nutrition support for food insecure households in rural Ethiopia. Three components will contribute to the achievement of the PSNP objective.\r\n<ul>\r\n 	<li><strong>Component one</strong> will provide support to the social protection and disaster risk management systems, including targeting, registration capacity development, management information systems, early warning triggers, and response mechanisms.</li>\r\n 	<li><strong>Component two</strong> will be delivered through three sub-components delivering key services of:\r\n<ul>\r\n 	<li>Safety net transfers to chronically food insecure households and support to a scalable response mechanism for transitory needs;</li>\r\n 	<li>Sustainable community assets and human capital investments and;</li>\r\n 	<li>Enhanced access to complementary livelihoods services for client households through crop and livestock production, off-farm income generating services, and labor/employment linkages.</li>\r\n</ul>\r\n</li>\r\n 	<li>Component three will support sustainable capacity development and institutional strengthening to support the PSNP.</li>\r\n</ul>\r\n<h2>National Agriculture Investment Plan</h2>\r\nEthiopia’s broad development goals are described in the Growth and Transformation Plan 2 (GTP2) (2015-2020), while agriculture sector goals are defined specifically in the National Agricultural Investment Framework (NAIF), which is currently being developed. The NAIF will operationalize the agricultural GTP 2, provide a framework for investment in the agriculture sector, and represent Ethiopia’s second generation Comprehensive Africa Agriculture Development Plan (CAADP) investment plan.', 'Programs', '', 'publish', 'closed', 'closed', '', 'programs', '', '', '2018-03-27 22:52:25', '2018-03-27 22:52:25', '', 0, 'http://54.201.28.233/?page_id=133', 0, 'page', '', 0),
