nagement systems, including targeting, registration capacity development, management information systems, early warning triggers, and response mechanisms.</li>\r\n 	<li><strong>Component two</strong> will be delivered through three sub-components delivering key services of:\r\n<ul>\r\n 	<li>Safety net transfers to chronically food insecure households and support to a scalable response mechanism for transitory needs;</li>\r\n 	<li>Sustainable community assets and human capital investments and;</li>\r\n 	<li>Enhanced access to complementary livelihoods services for client households through crop and livestock production, off-farm income generating services, and labor/employment linkages.</li>\r\n</ul>\r\n</li>\r\n 	<li>Component three will support sustainable capacity development and institutional strengthening to support the PSNP.</li>\r\n</ul>\r\n<h2>National Agriculture Investment Plan</h2>\r\nEthiopia’s broad development goals are described in the Growth and Transformation Plan 2 (GTP2) (2015-2020), while agriculture sector goals are defined specifically in the National Agricultural Investment Framework (NAIF), which is currently being developed. The NAIF will operationalize the agricultural GTP 2, provide a framework for investment in the agriculture sector, and represent Ethiopia’s second generation Comprehensive Africa Agriculture Development Plan (CAADP) investment plan.', 'Programs', '', 'inherit', 'closed', 'closed', '', '133-revision-v1', '', '', '2018-03-21 18:29:01', '2018-03-21 18:29:01', '', 133, 'http://54.201.28.233/index.php/2018/03/21/133-revision-v1/', 0, 'revision', '', 0),
