(204, 1, '2018-03-21 18:57:08', '2018-03-21 18:57:08', '<h2>About RED&amp;FS</h2>\r\nThe Rural Economic Development and Food Security (RED&amp;FS) Sector Working Group was established in 2008 to serve as a joint platform, bringing together the Government of Ethiopia (GoE), represented by the federal Ministry of Agriculture and Natural Resources (MoANR), Ministry of Livestock and Fisheries (MoLF), and the main development partners (DPs) engaged in the sectors. The platform’s objectives are to facilitate technical, operational and strategic level dialogue between the government and DPs and to mobilize and align development investments towards sector priorities identified by the GoE, as well as to harmonize investment and activities in order to maximize resource effectiveness. RED&amp;FS operates within the tenets and framework of the Paris Declaration on Aid Effectiveness.\r\n<h2>RED&amp;FS Organizational Structure</h2>\r\nRED&amp;FS is built on four pillar Technical Committees (TCs) that mirror the state ministerial structure of the two federal ministries, each chaired by the respective sector state minister and supported by two DP co-chairs. The TCs are: Livestock and Fisheries Production and Marketing; Agriculture Growth; Sustainable Land Management; and Rural Job Opportunity Creation and Food Security. Each TC is further broken down into focused sub-sector Task Forces (TFs) which are chaired by a government director and co-chaired by DP representatives. Oversight to the entire structure is provided through an Executive Committee chaired by the two federal ministers and also supported by DP co-chairs. The platform also features cross-sector TFs not aligned to any specific sector.\r\n\r\nThe RED&amp;FS Secretariat provides broad and agile support to the entire sector and consists of a Government Coordinator, Donor Coordinator, Monitoring and Evaluation (M&amp;E) Expert, and support staff. The RED&amp;FS Organizational Chart is shown below.\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n<h2>Contact Us</h2>\r\nRural Economic Development and Food Security (RED&amp;FS) Sector Working Group\r\n\r\nTelephone:- +251116461644\r\n\r\nPO.Box:- 62347', 'About RED&FS', '', 'inherit', 'closed', 'closed', '', '127-revision-v1', '', '', '2018-03-21 18:57:08', '2018-03-21 18:57:08', '', 127, 'http://54.201.28.233/index.php/2018/03/21/127-revision-v1/', 0, 'revision', '', 0),
(206, 1, '2018-03-21 18:59:00', '2018-03-21 18:59:00', '<h2>About RED&amp;FS</h2>\r\nThe Rural Economic Development and Food Security (RED&amp;FS) Sector Working Group was established in 2008 to serve as a joint platform, bringing together the Government of Ethiopia (GoE), represented by the federal Ministry of Agriculture and Natural Resources (MoANR), Ministry of Livestock and Fisheries (MoLF), and the main development partners (DPs) engaged in the sectors. The platform’s objectives are to facilitate technical, operational and strategic level dialogue between the government and DPs and to mobilize and align development investments towards sector priorities identified by the GoE, as well as to harmonize investment and activities in order to maximize resource effectiveness. RED&amp;FS operates within the tenets and framework of the Paris Declaration on Aid Effectiveness.\r\n<h2>RED&amp;FS Organizational Structure</h2>\r\nRED&amp;FS is built on four pillar Technical Committees (TCs) that mirror the state ministerial structure of the two federal ministries, each chaired by the respective sector state minister and supported by two DP co-chairs. The TCs are: Livestock and Fisheries Production and Marketing; Agriculture Growth; Sustainable Land Management; and Rural Job Opportunity Creation and Food Security. Each TC is further broken down into focused sub-sector Task Forces (TFs) which are chaired by a government director and co-chaired by DP representatives. Oversight to the entire structure is provided through an Executive Committee chaired by the two federal ministers and also supported by DP co-chairs. The platform also features cross-sector TFs not aligned to any specific sector.\r\n\r\nThe RED&amp;FS Secretariat provides broad and agile support to the entire sector and consists of a Government Coordinator, Donor Coordinator, Monitoring and Evaluation (M&amp;E) Expert, and support staff. The RED&amp;FS Organizational Chart is shown below.\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;', 'About RED&FS', '', 'inherit', 'closed', 'closed', '', '127-revision-v1', '', '', '2018-03-21 18:59:00', '2018-03-21 18:59:00', '', 127, 'http://54.201.28.233/index.php/2018/03/21/127-revision-v1/', 0, 'revision', '', 0),
(207, 1, '2018-03-21 21:20:59', '2018-03-21 21:20:59', '<strong>Q 1. What is REDFS SWG? </strong>\r\n\r\nThe Rural Economic Development and Food Security Sector Working Group (REDFS SWG) is the joint Government - Donor coordination platform for agriculture, Natural Resource Management and Food Security. Its objective is to jointly review sector level implementation status, coordinate and harmonize efforts of various development partners supporting flagship programmes under REDFS.\r\n\r\n<strong>Q 2. Who chaired the REDFS SWG? </strong>\r\n\r\nThe SWG is chaired by two federal Ministers, namely H.E. Dr. Eyasu Abraha, Minister, Ministry of Agriculture &amp; Natural Resources and H.E. Professor Fekadu Beyene; Minister, Ministry of Livestock and Fishery, and co-chaired by EU’s Dominique Davoux and USAID’s Stephen Morin.\r\n\r\n<strong>Q 3. When was REDFS SWG established?</strong>\r\n\r\nThe REDFS SWG was formally established in April 2008, and is composed of an Executive Committee and four Technical Committees namely, Agricultural Growth; Sustainable Land Management; Livestock &amp; Fisheries Development and Rural Job Opportunity Creation and Food Security.\r\n\r\n<strong> Q 4. Who are members of the REDFS SWG?</strong>\r\n\r\nThe RED&amp;FS membership includes the Ministries of Agriculture and Natural Resources and Livestock &amp; Fisheries Resources and their associated Directorates. Membership from Development Partners side includes the major Multi and Bi-Lateral Development Institutions that are engaged in the aforementioned sectors. Participation in the Technical Committees is open to those institutions that have the interest, expertise and capacity to engage in and contribute to the work of the sector.\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;', 'FAQs', '', 'inherit', 'closed', 'closed', '', '86-revision-v1', '', '', '2018-03-21 21:20:59', '2018-03-21 21:20:59', '', 86, 'http://54.201.28.233/index.php/2018/03/21/86-revision-v1/', 0, 'revision', '', 0),
